import "./header.css";

import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
const images = [
  "https://hips.hearstapps.com/hmg-prod/images/cvanessadewson-nature-4-1618585013.jpg?crop=1xw:0.8430474604496253xh;center,top&resize=2048:*",
  "https://as1.ftcdn.net/v2/jpg/00/87/96/92/1000_F_87969260_J3BI772FEfUQYjrv0mSxnY2sAK2uJ47T.jpg",
  "https://media.istockphoto.com/id/887987150/photo/blogging-woman-reading-blog.jpg?s=612x612&w=0&k=20&c=7SScR_Y4n7U3k5kBviYm3VwEmW4vmbngDUa0we429GA=",
  "https://images.unsplash.com/photo-1530819568329-97653eafbbfa?q=80&w=1000&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSdDa5YlJVI1j27YpNdNIrugX4IN9p8d0Q61u_gnS_3q3lFBNhM3LCXI5mZFoZGG5wLqFc&usqp=CAU"

];
export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitleLg">Blog Website</span>
      </div>
      <div className="headerImg">
      <Carousel useKeyboardArrows={true} className="headerImg">
        {images.map((URL, index) => (
          <div className="headerImg">
            <img alt="sample_file" src={URL} key={index} />
          </div>
        ))}
      </Carousel>
      </div>
    </div>
  );
}
